query:
mutation containerFqdnCreateFromList ( $accountId:ID! $createFqdnContainerFromListInput:CreateFqdnContainerFromListInput!) {
	container ( accountId:$accountId ) {
		fqdn {
			createFromList ( input:$createFqdnContainerFromListInput   ) {
				container {
					id
					name
					description
					size
					audit {
						createdBy
						lastModifiedBy
						lastModifiedAt
						createdAt
					}
					syncData {
						fileType
						url
						timeInterval
						timeUnit
						notifications {
							subscriptionGroup {
								id
								name
							}
							webhook {
								id
								name
							}
							mailingList {
								id
								name
							}
						}
					}
					syncDataAudit {
						lastSynced
						lastSyncAttempt
						errorMsg
					}
				}
			}
		}
	}	
}
